    [],nt"revision_timestamp": "2014-11-19T18:15:46.719911",nt"name": "regulated-environmental-activity-sites-criticalerosion",nt"isopen":
    false,nt"url": null,nt"notes": "Created based on the Critical Erosion Report
    for 2005. Indicates the condition of shoreline, determined by our staff of Coastal
    Engineers, for the year 2005. This report is used to document areas of change and
    to help the beach management staff with prioritizing projects and resources to the
    areas of greatest need. Downloaded from: http://www.dep.state.fl.us/beaches/data/gis-data.htm.
    Attribute accuracy report: NOT drawn to any accuracy level. Only a graphic to generally
    indicate areas of erosion. Specifics contained in the written report. NOT to be
    used in engineering or surveying determinations. Completeness report: Lines were
    drawn to roughly conform to the shoreline on the "Counties in Florida" shapefile
    issued by FDEP. This has not been updated for several years and may not be the way
    the coast line looks today. Since the Erosion shapefile is to be used only as a
    graphic in the maps that are generated for the report we did not require any survey
    quality accuracy. This is the final version for the year 2005 Online Linkage: http://www.dep.state.fl.us/beaches/publications/tech-rpt.htm#Critical_Erosion_Reports",nt"license_title":
